import React from "react";
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

const Notes = (prop) => {
   


    return (
        <>
            <div class="row">
                <div class="col col-2 mr-4">
                    <form className="text-center  p-3 mt-5 ">
                        <div class="card shadow-lg " style={{ width: "15rem" }}>
                            <h4 className="pt-2">{pro}</h4>
                            <div class="card-body">
                                <p>My name is jawad</p>
                                <Button className="bton1 shadow-lg">
                                    <DeleteIcon />
                                </Button>
                            </div>
                        </div>
                    </form>
                </div>
               

            </div>


        </>
    )
}
export default Notes;
